import React, { Component } from "react";
import { PieChart, Pie, Sector, Cell, ResponsiveContainer } from "recharts";

class DOA extends Component {
  state = {
    chart: {}
  };
  constructor(props) {
    super(props);
    this.state.chart = { msg: "test chart", osX: [], osY: [] };
  }

  render() {
    const data01 = [
      { name: "Group A", value: 400 },
      { name: "Group B", value: 300 },
      { name: "Group C", value: 300 },
      { name: "Group D", value: 200 }
    ];
    const data02 = [
      { name: "A1", value: 100 },
      { name: "A2", value: 300 },
      { name: "B1", value: 100 },
      { name: "B2", value: 80 },
      { name: "B3", value: 40 },
      { name: "B4", value: 30 },
      { name: "B5", value: 50 },
      { name: "C1", value: 100 },
      { name: "C2", value: 200 },
      { name: "D1", value: 150 },
      { name: "D2", value: 50 }
    ];
    return (
      <div style={{ width: "100%", height: 400, padding: 0 }}>
        <ResponsiveContainer>
          <PieChart width={400} height={400}>
            <Pie
              data={data01}
              dataKey="value"
              cx={200}
              cy={200}
              outerRadius={60}
              fill="#8884d8"
            />
            <Pie
              data={data02}
              dataKey="value"
              cx={200}
              cy={200}
              innerRadius={70}
              outerRadius={90}
              fill="#82ca9d"
              label
            />
          </PieChart>
        </ResponsiveContainer>
      </div>
    );
  }
}

export default DOA;
